import java.util.Arrays;
import java.util.HashMap;
import java.util.Scanner;

class  Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long k = sc.nextInt();
        long[] numsA = new long[n];
        long[] numsB = new long[n];
        long sumA = 0;
        long sumB = 0;
        for (int i = 0; i < numsA.length; i++) {
            numsA[i] = sc.nextLong();
            sumA += numsA[i];
        }

        for (int i = 0; i < numsA.length; i++) {
            numsB[i] = sc.nextLong();
            sumB += numsB[i];
        }

        Arrays.sort(numsA);
        Arrays.sort(numsB);
        boolean[] check = new boolean[n];
        int[] checkA = new int[n];
        HashMap<Integer, Boolean> ma = new HashMap<>();
        if (Math.abs(sumA - sumB) <= k) {
            int i = 0;
            int j = 0;
            int count = 0;
            while (i < n && j < n) {
                if (numsA[i] < numsB[j]) {
                    i++;
                } else if (numsA[i] > numsB[j]) {
                    j++;
                } else {
                    i++;
                    j++;
                    count++;
                }
            }
            if (count == n - 1 || count == n) System.out.println("YES"); else System.out.println("NO");
        } else {
            System.out.println("NO");
        }
    }
}
